import './ExploreContainer.css';

const Temp = (props: any) => {
  return (
    <div className="flex mt-10">
      <div className="flex-center text-6xl">RUMAH</div>
      <div className="flex-center text-6xl">{props.temp} &deg;</div>
    </div>
  );
};

export default Temp;
